from typing import List


class NoPossibleJobFoundException(Exception):
    def __init__(self):
        self.message = "No possible job is found for the selected worker."
        super().__init__(self.message)


class Solution:
    def maxProfitAssignment(self, difficulty: List[int], profit: List[int], worker: List[int]) -> int:
        list_of_jobs = [Job(difficulty=d, profit=p) for (d, p) in zip(difficulty, profit)]
        list_of_jobs = sorted(list_of_jobs, key=lambda job: job.profit, reverse=True)
        list_of_workers = [Worker(identity=i, ability=a) for (i, a) in enumerate(worker)]
        list_of_workers = sorted(list_of_workers, key=lambda worker_: worker_.ability, reverse=True)
        coordinator = Coordinator(list_of_workers)
        coordinator.assign_jobs(list_of_jobs)
        total_profit = coordinator.get_total_profit()
        return total_profit


class Job:
    difficulty: int
    profit: int

    def __init__(self, difficulty: int, profit: int) -> None:
        self.difficulty = difficulty
        self.profit = profit


class Worker:
    ability: int
    _id: int

    def __init__(self, identity: int, ability: int) -> None:
        self.ability = ability
        self._id = identity

    def can_complete_job(self, job: Job) -> bool:
        can_complete = self.ability >= job.difficulty
        return can_complete

    def __eq__(self, other) -> bool:
        return self._id == other._id


class Coordinator:
    profit: int
    workers: List[Worker]
    last_job_index: int

    def __init__(self, list_of_workers: List[Worker]) -> None:
        self.profit = 0
        self.workers = list_of_workers
        self.last_job_index = 0

    def get_total_profit(self) -> int:
        return self.profit

    def assign_job_to_worker(self, worker: Worker, job: Job) -> None:
        self.profit += job.profit

    def assign_jobs(self, jobs: List[Job]) -> None:
        for worker in self.workers:
            try:
                job = self.find_best_job_for_worker(worker, jobs)
                self.assign_job_to_worker(worker, job)
            except NoPossibleJobFoundException:
                continue

    def find_best_job_for_worker(self, worker: Worker, jobs: List[Job]) -> Job:
        while self.last_job_index < len(jobs):
            job = jobs[self.last_job_index]
            if job.difficulty <= worker.ability:
                return job
            self.last_job_index += 1
        raise NoPossibleJobFoundException


